import Togglable from './Togglable'

const Blog = ({ blog, toggleDetails }) => {

  return (
    <li className='blog'>
      {blog.title} by {blog.author} 
      <Togglable buttonLabel="view">
        <div>{blog.url}</div>
        <div>{blog.likes}</div>
      </Togglable>  
    </li>  
  )
}

export default Blog
